INSERT INTO `recipe` (`recipe_id`, `name`, `category_id`, `administrator_id`, `created_at`, `instructions`) VALUES
	(1, 'Sarma', 1, 1, '2020-08-24 21:43:55', 'Izdinstati luk seckan na kockice, dodati mu sitno seckan beli luk i sargarepicu, prodinstati jos malo.\nDodati sitno seckanu slaninicu da se malo proprzi.\n'),
	(2, 'Gulas', 1, 1, '2020-08-25 21:54:24', 'Oljustite crni luk i sitno ga naseckajte. Meso narezite na kockice. Na zagrejanom ulju przite luk dok ne postakli i dobije tamno zutu boju, pa dolijte vode ( ca 300 ml ) i ostavite da se dinsta na srednjoj temperaturi ca 20 minuta.\n'),
	(5, 'Tiramisu', 6, 1, '2020-08-25 22:00:07', 'Template instruction Template instruction Template instruction Template instruction Template instruction'),
	(9, 'Baklava', 6, 1, '2020-09-14 19:17:25', 'Baklava se ovako priprema'),
	(10, 'Paprikas', 1, 1, '2020-09-17 13:15:57', 'Na zagrejanom ulju ili masti proprziti sitno iseckan crni luk, dodati na kolutove isecenu sargarenu, isecenu papriku, meso, posoliti po ukusu, i dinstati uz povremeno dolivanje vode'),
	(11, 'AddRecipeTest', 2, 1, '2020-09-17 13:16:27', 'Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions '),
	(12, 'awdwadaw', 2, 1, '2020-09-17 13:17:25', 'Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions Instructions '),
	(13, 'Pasulj', 1, 1, '2020-09-17 13:23:21', 'Staviti u serpu kobasice, luk, sargarepu i pasulj i kuvati dok ne bude gotovo.');
